    duration: 4000,
    autoplay: false,
    update: function (anim) {
      if (anim.progress > progress) {

      }

      if (Math.round(progress) >= 32) {
        group_1.play();
      }

      if (Math.round(progress) >= 42) {
        group_2.play();
      }

      if (Math.round(progress) >= 50) {

      }

        group_4.play();
      }

      if (Math.round(progress) >= 70) {
        group_5.play();
      }

      if (Math.round(progress) == 100) {
        animBoolean = true;
      }
    },
  });

  const scrollPercent = () => {
    const bodyST = document.body.scrollTop;
    const docST = document.documentElement.scrollTop;
    const docSH = document.documentElement.scrollHeight;
    const docCH = document.documentElement.clientHeight;

    return ((docST + bodyST) / (docSH - docCH)) * 180;
  };

  window.onscroll = () => {
    if (animBoolean == false) {
      if (scrollProgress < (scrollPercent() / 100) * lineDrawing.duration) {
        scrollProgress = (scrollPercent() / 100) * lineDrawing.duration;
      }
      if (Math.round(progress) < 70) {
        lineDrawing.seek(scrollProgress);
      } else {
        lineDrawing.play();
      }
      // lineDrawing.seek(scrollProgress);

    {
      scale: 0,
      duration: 1,
      ease: "Power3.easeOut",
      transformOrigin: "center",
    },
    0
  );

  circleTimeline.from(
    "#inner-circle-text",
    {
      opacity: 0,
      y: 10,
      duration: 1,
      ease: "Power3.easeOut",
      transformOrigin: "center",
    },
    0.5
  );

  circleTimeline.from(
    "#outter-circle",
    {
      scale: 0,
      duration: 1,
      ease: "Power3.easeOut",
      transformOrigin: "center",
    },
    0.5
  );

  circleTimeline.from(
    Array.from({ length: 7 }, (v, k) => "#line_" + (k + 1)).concat(["#line"]),
    {
      scale: 0,
      duration: 1,
      ease: "Power3.easeOut",
      transformOrigin: "center center",
    },
    1
  );

  circleTimeline.from(
    Array.from({ length: 8 }, (v, k) => "#black-dot_" + (k + 1)).concat([
      "#black-dot",
    ]),
    {
      scale: 0,
      duration: 1,
      ease: "Elastic.easeOut",
      transformOrigin: "center",
    },
    "<+=0.5"
  );

  circleTimeline.from(
    Array.from({ length: 8 }, (v, k) => "#black-text_" + (k + 1)).concat([
      "#black-text",
    ]),
    {
      opacity: 0,
      x: -10,
      duration: 1,
      ease: "Power3.easeOut",
      transformOrigin: "center",
    },
    "<+=0.5"
  );

  circleTimeline.from(
    Array.from({ length: 28 }, (v, k) => "#red-dot_" + (k + 1)).concat([
      "#red-dot",
    ]),
    {
      scale: 0,
      duration: 1,
      ease: "Elastic.easeOut",
      transformOrigin: "center",
    },
    "<+=0.5"
  );

  circleTimeline.from(
    Array.from({ length: 31 }, (v, k) => "#red-text_" + (k + 1)).concat([
      "#red-text",
    ]),
    {
      opacity: 0,
      x: -10,
      duration: 1,
      ease: "Power3.easeOut",
      transformOrigin: "center",
    },
    "<+=0.5"
  );

  const avaliacaoTimeline = gsap.timeline({
    paused: true,
    scrollTrigger: {
      trigger: "#avaliacao-arrow",
      start: "top 80%",
    },
  });

  avaliacaoTimeline.from("#avaliacao-arrow", {
    opacity: 0,
    scale: 0,
    duration: 1,
    transformOrigin: "top center",
    ease: "Power3.easeOut",
  });

  avaliacaoTimeline.from("#avaliacao-circle", {
    scale: 0,
    duration: 1,
    ease: "Power3.easeOut",
    transformOrigin: "center",
  });

  avaliacaoTimeline.from(
    "#avaliacao-text",
    {
      opacity: 0,
      y: 10,
      duration: 1,
      ease: "Power3.easeOut",
      transformOrigin: "center",
    },
    "<+=0.5"
  );
</script>
